class BenchMeta:
    def __init__(self, name, tp, color, members):
        assert tp in {"TO", "QU"}
        assert name in {"Mariposa", "Verus"}
        self.tp = tp
        self.name = name
        self.color = color
        if tp == "TO":
            self.line_style = "-"
        else:
            self.line_style = "--"
        self.members = members

    def full_name(self):
        return f"{self.name} {self.tp}"

MP_TO = BenchMeta("Mariposa", "TO", "blue", mariposa_tos)
MP_QU = BenchMeta("Mariposa", "QU", "blue", mariposa_qus)
VS_TO = BenchMeta("Verus", "TO", "orange", verus_tos)
VS_QU = BenchMeta("Verus", "QU", "orange", verus_qus)

METAS = [MP_TO, MP_QU, VS_TO, VS_QU]